import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  min-height: 70vh;
  background-color: rgb(190, 188, 189);
`;

function Errorpage() {
  return <Wrapper>Errorpage</Wrapper>;
}

export default Errorpage;
